import React from 'react';
import './App.css';
import DataForm from './components/DataForm'

function App() {
  return (
    <div className="App" style={{display: 'flex', justifyContent: 'center', alignContent: 'center'}}>
        <DataForm />
    </div>
  );
}

export default App;
